                "body": "Is this totally disgusting or a small improvement.\r\n\r\nThe resulting SQL query would be something like:\r\n\r\n```sql\r\nSELECT \"dhci\".\"InstrumentId\",TIME_FORMAT(\"dhci\".\"AppointmentStartTime\",'%H:%i') \"AppointmentTime\",CASE WHEN \"dhci\".\"GroupName\"='TNS' THEN 'Other' WHEN \"dhci\".\"GroupName\"='WLS' THEN 'Welsh' ELSE 'English' END \"AppontmentLanguage\",\"dh\".\"DialResult\",COUNT(*) \"Total\" FROM \"dhci\" LEFT JOIN (SELECT \"InstrumentId\",\"PrimaryKeyValue\",\"AdditionalData\",\"DialResult\",MAX(\"StartTime\") FROM \"dial_history\") ON \"dhci\".\"\"PrimaryKeyValue\"=\"PrimaryKeyValue\"\"=\"dh\".\"\"PrimaryKeyValue\"=\"PrimaryKeyValue\"\" WHERE \"dhci\".\"AppointmentStartDate\" LIKE 'foo%' GROUP BY \"dhci\".\"InstrumentId\",\"dhci\".\"AppointmentTime\",\"dhci\".\"AppointmentLanguage\",\"dial_history\".\"DialResult\" ORDER BY \"dhci\".\"AppointmentTime\" ASC,\"dhci\".\"AppointmentLanguage\" ASC\r\n```",
