                "body": "Bumps [@testing-library/dom](https://github.com/testing-library/dom-testing-library) from 7.30.4 to 8.3.0.\n<details>\n<summary>Release notes</summary>\n<p><em>Sourced from <a href=\"https://github.com/testing-library/dom-testing-library/releases\"><code>@​testing-library/dom</code>'s releases</a>.</em></p>\n<blockquote>\n<h2>v8.3.0</h2>\n<h1><a href=\"https://github.com/testing-library/dom-testing-library/compare/v8.2.0...v8.3.0\">8.3.0</a> (2021-09-07)</h1>\n<h3>Features</h3>\n<ul>\n<li>restore prettyDOM logging for Cypress (<a href=\"https://github-redirect.dependabot.com/testing-library/dom-testing-library/issues/1018\">#1018</a>) (<a href=\"https://github.com/testing-library/dom-testing-library/commit/460115a471bcbd7e963f2751f7544bfe6f10f828\">460115a</a>)</li>\n</ul>\n<h2>v8.2.0</h2>\n<h1><a href=\"https://github.com/testing-library/dom-testing-library/compare/v8.1.1...v8.2.0\">8.2.0</a> (2021-08-25)</h1>\n<h3>Features</h3>\n<ul>\n<li><strong>ByRole:</strong> Allow filter by <code>aria-current</code> state (<a href=\"https://github-redirect.dependabot.com/testing-library/dom-testing-library/issues/943\">#943</a>) (<a href=\"https://github.com/testing-library/dom-testing-library/commit/fbbb29a6d9655d41bc8f91d49dc64326f588c0d6\">fbbb29a</a>)</li>\n</ul>\n<h2>v8.1.1</h2>\n<h2><a href=\"https://github.com/testing-library/dom-testing-library/compare/v8.1.0...v8.1.1\">8.1.1</a> (2021-08-25)</h2>\n<h3>Bug Fixes</h3>\n<ul>\n<li>support getting text of inputs of type <code>reset</code> (<a href=\"https://github-redirect.dependabot.com/testing-library/dom-testing-library/issues/1011\">#1011</a>) (<a href=\"https://github.com/testing-library/dom-testing-library/commit/54b9a5fd9c88018f042f6d1e9d7ae55c6257de98\">54b9a5f</a>)</li>\n</ul>\n<h2>v8.1.0</h2>\n<h1><a href=\"https://github.com/testing-library/dom-testing-library/compare/v8.0.0...v8.1.0\">8.1.0</a> (2021-07-01)</h1>\n<h3>Features</h3>\n<ul>\n<li><strong>fireEvent:</strong> Add resize event (<a href=\"https://github-redirect.dependabot.com/testing-library/dom-testing-library/issues/990\">#990</a>) (<a href=\"https://github.com/testing-library/dom-testing-library/commit/75197fe09a85646a6ca1d877f5dde21da60e6b76\">75197fe</a>)</li>\n</ul>\n<h2>v8.0.0</h2>\n<h1><a href=\"https://github.com/testing-library/dom-testing-library/compare/v7.31.2...v8.0.0\">8.0.0</a> (2021-06-23)</h1>\n<h3>Recommendations</h3>\n<ol>\n<li>If you're using <code>jest</code> fake timers make sure you use modern timers\njest 27:\n<pre lang=\"diff\"><code>-jest.useFakeTimers('legacy')\n+jest.useFakeTimers('modern')\n // jest.config.js\n-&quot;timers&quot;: &quot;legacy&quot;,\n+&quot;timers&quot;: &quot;modern&quot;,\n</code></pre>\njest 26:\n<pre lang=\"diff\"><code>-jest.useFakeTimers()\n+jest.useFakeTimers('modern')\n // jest.config.js\n</code></pre>\n</li>\n</ol>\n<!-- raw HTML omitted -->\n</blockquote>\n<p>... (truncated)</p>\n</details>\n<details>\n<summary>Commits</summary>\n<ul>\n<li><a href=\"https://github.com/testing-library/dom-testing-library/commit/ba8dfb884bb2ece1d384b418e4aa1076d37c815d\"><code>ba8dfb8</code></a> docs: add istateside as a contributor for code, test (<a href=\"https://github-redirect.dependabot.com/testing-library/dom-testing-library/issues/1024\">#1024</a>)</li>\n<li><a href=\"https://github.com/testing-library/dom-testing-library/commit/460115a471bcbd7e963f2751f7544bfe6f10f828\"><code>460115a</code></a> feat: restore prettyDOM logging for Cypress (<a href=\"https://github-redirect.dependabot.com/testing-library/dom-testing-library/issues/1018\">#1018</a>)</li>\n<li><a href=\"https://github.com/testing-library/dom-testing-library/commit/bb79e3027df4e10f04bf10a13bf5a8f85723e876\"><code>bb79e30</code></a> chore(types): Convert src/query-helpers to TS (<a href=\"https://github-redirect.dependabot.com/testing-library/dom-testing-library/issues/1016\">#1016</a>)</li>\n<li><a href=\"https://github.com/testing-library/dom-testing-library/commit/ff84a50d32f58cac44407c8bcdf0b887e080afb6\"><code>ff84a50</code></a> docs: add savcni01 as a contributor for code (<a href=\"https://github-redirect.dependabot.com/testing-library/dom-testing-library/issues/1017\">#1017</a>)</li>\n<li><a href=\"https://github.com/testing-library/dom-testing-library/commit/fbbb29a6d9655d41bc8f91d49dc64326f588c0d6\"><code>fbbb29a</code></a> feat(ByRole): Allow filter by <code>aria-current</code> state (<a href=\"https://github-redirect.dependabot.com/testing-library/dom-testing-library/issues/943\">#943</a>)</li>\n<li><a href=\"https://github.com/testing-library/dom-testing-library/commit/d03f4f6f6ea106fa853bbf3e745358f1f1371420\"><code>d03f4f6</code></a> docs: add riotrah as a contributor for code (<a href=\"https://github-redirect.dependabot.com/testing-library/dom-testing-library/issues/1015\">#1015</a>)</li>\n<li><a href=\"https://github.com/testing-library/dom-testing-library/commit/066a41f80e9a6d3c0d248a3ed915c1c52501cf4b\"><code>066a41f</code></a> chore: Convert screen.js to TypeScript (<a href=\"https://github-redirect.dependabot.com/testing-library/dom-testing-library/issues/1002\">#1002</a>)</li>\n<li><a href=\"https://github.com/testing-library/dom-testing-library/commit/992f8b585cc8c8345f14388f700ef3d7084902c7\"><code>992f8b5</code></a> docs: add G-Rath as a contributor for code, test (<a href=\"https://github-redirect.dependabot.com/testing-library/dom-testing-library/issues/1014\">#1014</a>)</li>\n<li><a href=\"https://github.com/testing-library/dom-testing-library/commit/54b9a5fd9c88018f042f6d1e9d7ae55c6257de98\"><code>54b9a5f</code></a> fix: support getting text of inputs of type <code>reset</code> (<a href=\"https://github-redirect.dependabot.com/testing-library/dom-testing-library/issues/1011\">#1011</a>)</li>\n<li><a href=\"https://github.com/testing-library/dom-testing-library/commit/91b9dc3b6f5deea88028e97aab15b3b9f3289a2a\"><code>91b9dc3</code></a> test: Fix missing coverage for else-if (<a href=\"https://github-redirect.dependabot.com/testing-library/dom-testing-library/issues/1013\">#1013</a>)</li>\n<li>Additional commits viewable in <a href=\"https://github.com/testing-library/dom-testing-library/compare/v7.30.4...v8.3.0\">compare view</a></li>\n</ul>\n</details>\n<br />\n\n\n[![Dependabot compatibility score](https://dependabot-badges.githubapp.com/badges/compatibility_score?dependency-name=@testing-library/dom&package-manager=npm_and_yarn&previous-version=7.30.4&new-version=8.3.0)](https://docs.github.com/en/github/managing-security-vulnerabilities/about-dependabot-security-updates#about-compatibility-scores)\n\nDependabot will resolve any conflicts with this PR as long as you don't alter it yourself. You can also trigger a rebase manually by commenting `@dependabot rebase`.\n\n[//]: # (dependabot-automerge-start)\n[//]: # (dependabot-automerge-end)\n\n---\n\n<details>\n<summary>Dependabot commands and options</summary>\n<br />\n\nYou can trigger Dependabot actions by commenting on this PR:\n- `@dependabot rebase` will rebase this PR\n- `@dependabot recreate` will recreate this PR, overwriting any edits that have been made to it\n- `@dependabot merge` will merge this PR after your CI passes on it\n- `@dependabot squash and merge` will squash and merge this PR after your CI passes on it\n- `@dependabot cancel merge` will cancel a previously requested merge and block automerging\n- `@dependabot reopen` will reopen this PR if it is closed\n- `@dependabot close` will close this PR and stop Dependabot recreating it. You can achieve the same result by closing it manually\n- `@dependabot ignore this major version` will close this PR and stop Dependabot creating any more for this major version (unless you reopen the PR or upgrade to it yourself)\n- `@dependabot ignore this minor version` will close this PR and stop Dependabot creating any more for this minor version (unless you reopen the PR or upgrade to it yourself)\n- `@dependabot ignore this dependency` will close this PR and stop Dependabot creating any more for this dependency (unless you reopen the PR or upgrade to it yourself)\n\n\n</details>",
