                "body": "Bumps [dotenv](https://github.com/motdotla/dotenv) from 8.2.0 to 10.0.0.\n<details>\n<summary>Changelog</summary>\n<p><em>Sourced from <a href=\"https://github.com/motdotla/dotenv/blob/master/CHANGELOG.md\">dotenv's changelog</a>.</em></p>\n<blockquote>\n<h2><a href=\"https://github.com/motdotla/dotenv/compare/v9.0.2...v10.0.0\">10.0.0</a> (2021-05-20)</h2>\n<h3>Added</h3>\n<ul>\n<li>Add generic support to parse function</li>\n<li>Allow for import &quot;dotenv/config.js&quot;</li>\n<li>Add support to resolve home directory in path via ~</li>\n</ul>\n<h2><a href=\"https://github.com/motdotla/dotenv/compare/v9.0.1...v9.0.2\">9.0.2</a> (2021-05-10)</h2>\n<h3>Changed</h3>\n<ul>\n<li>Support windows newlines with debug mode</li>\n</ul>\n<h2><a href=\"https://github.com/motdotla/dotenv/compare/v9.0.0...v9.0.1\">9.0.1</a> (2021-05-08)</h2>\n<h3>Changed</h3>\n<ul>\n<li>Updates to README</li>\n</ul>\n<h2><a href=\"https://github.com/motdotla/dotenv/compare/v8.6.0...v9.0.0\">9.0.0</a> (2021-05-05)</h2>\n<h3>Changed</h3>\n<ul>\n<li><em>Breaking:</em> drop support for Node v8</li>\n</ul>\n<h2><a href=\"https://github.com/motdotla/dotenv/compare/v8.5.1...v8.6.0\">8.6.0</a> (2021-05-05)</h2>\n<h3>Added</h3>\n<ul>\n<li>define package.json in exports</li>\n</ul>\n<h2><a href=\"https://github.com/motdotla/dotenv/compare/v8.5.0...v8.5.1\">8.5.1</a> (2021-05-05)</h2>\n<h3>Changed</h3>\n<ul>\n<li>updated dev dependencies via npm audit</li>\n</ul>\n<h2><a href=\"https://github.com/motdotla/dotenv/compare/v8.4.0...v8.5.0\">8.5.0</a> (2021-05-05)</h2>\n<h3>Added</h3>\n<ul>\n<li>allow for <code>import &quot;dotenv/config&quot;</code></li>\n</ul>\n<h2><a href=\"https://github.com/motdotla/dotenv/compare/v8.3.0...v8.4.0\">8.4.0</a> (2021-05-05)</h2>\n<h3>Changed</h3>\n<ul>\n<li>point to exact types file to work with VS Code</li>\n</ul>\n<!-- raw HTML omitted -->\n</blockquote>\n<p>... (truncated)</p>\n</details>\n<details>\n<summary>Commits</summary>\n<ul>\n<li><a href=\"https://github.com/motdotla/dotenv/commit/8c0c22719de756fe15f6c514d4599f5ed25faf18\"><code>8c0c227</code></a> Merge pull request <a href=\"https://github-redirect.dependabot.com/motdotla/dotenv/issues/536\">#536</a> from motdotla/changelog</li>\n<li><a href=\"https://github.com/motdotla/dotenv/commit/d43beaa1fb50f8d2f87eb6cc85c1ad1023975307\"><code>d43beaa</code></a> Bump 10.0.0</li>\n<li><a href=\"https://github.com/motdotla/dotenv/commit/a558363976da8cbdf5c0f8d2136737e34272e982\"><code>a558363</code></a> Merge pull request <a href=\"https://github-redirect.dependabot.com/motdotla/dotenv/issues/531\">#531</a> from ericmorand/issue_530</li>\n<li><a href=\"https://github.com/motdotla/dotenv/commit/8dc2e719986bc6963e6866840f66b462040ff816\"><code>8dc2e71</code></a> Merge pull request <a href=\"https://github-redirect.dependabot.com/motdotla/dotenv/issues/528\">#528</a> from brelian/pylon/support-homedir</li>\n<li><a href=\"https://github.com/motdotla/dotenv/commit/a70b641d9856b485dc171d21a635b90fba8464b8\"><code>a70b641</code></a> Merge pull request <a href=\"https://github-redirect.dependabot.com/motdotla/dotenv/issues/534\">#534</a> from paulrobertlloyd/patch-1</li>\n<li><a href=\"https://github.com/motdotla/dotenv/commit/3b2735aa392bfa6b974cfa96c33765c08f998b07\"><code>3b2735a</code></a> Update CHANGELOG</li>\n<li><a href=\"https://github.com/motdotla/dotenv/commit/a5daab374a4592a8e0a5d518a8b048084e6e3657\"><code>a5daab3</code></a> Update CHANGELOG</li>\n<li><a href=\"https://github.com/motdotla/dotenv/commit/c2cd81fc30cbefd3a8919ef9dd7a6dc9c6689ce5\"><code>c2cd81f</code></a> allow for import &quot;dotenv/config.js&quot;</li>\n<li><a href=\"https://github.com/motdotla/dotenv/commit/7bb704678e6bd0437feaf20dce98eedbd1c0bb7d\"><code>7bb7046</code></a> Merge pull request <a href=\"https://github-redirect.dependabot.com/motdotla/dotenv/issues/533\">#533</a> from motdotla/remove-funding</li>\n<li><a href=\"https://github.com/motdotla/dotenv/commit/dc6b75802678011ae72621e8f60429b697739452\"><code>dc6b758</code></a> Update README</li>\n<li>Additional commits viewable in <a href=\"https://github.com/motdotla/dotenv/compare/v8.2.0...v10.0.0\">compare view</a></li>\n</ul>\n</details>\n<br />\n\n\n[![Dependabot compatibility score](https://dependabot-badges.githubapp.com/badges/compatibility_score?dependency-name=dotenv&package-manager=npm_and_yarn&previous-version=8.2.0&new-version=10.0.0)](https://docs.github.com/en/github/managing-security-vulnerabilities/about-dependabot-security-updates#about-compatibility-scores)\n\nDependabot will resolve any conflicts with this PR as long as you don't alter it yourself. You can also trigger a rebase manually by commenting `@dependabot rebase`.\n\n[//]: # (dependabot-automerge-start)\n[//]: # (dependabot-automerge-end)\n\n---\n\n<details>\n<summary>Dependabot commands and options</summary>\n<br />\n\nYou can trigger Dependabot actions by commenting on this PR:\n- `@dependabot rebase` will rebase this PR\n- `@dependabot recreate` will recreate this PR, overwriting any edits that have been made to it\n- `@dependabot merge` will merge this PR after your CI passes on it\n- `@dependabot squash and merge` will squash and merge this PR after your CI passes on it\n- `@dependabot cancel merge` will cancel a previously requested merge and block automerging\n- `@dependabot reopen` will reopen this PR if it is closed\n- `@dependabot close` will close this PR and stop Dependabot recreating it. You can achieve the same result by closing it manually\n- `@dependabot ignore this major version` will close this PR and stop Dependabot creating any more for this major version (unless you reopen the PR or upgrade to it yourself)\n- `@dependabot ignore this minor version` will close this PR and stop Dependabot creating any more for this minor version (unless you reopen the PR or upgrade to it yourself)\n- `@dependabot ignore this dependency` will close this PR and stop Dependabot creating any more for this dependency (unless you reopen the PR or upgrade to it yourself)\n\n\n</details>",
