                "body": "Bumps [@testing-library/user-event](https://github.com/testing-library/user-event) from 13.1.5 to 13.2.1.\n<details>\n<summary>Release notes</summary>\n<p><em>Sourced from <a href=\"https://github.com/testing-library/user-event/releases\"><code>@​testing-library/user-event</code>'s releases</a>.</em></p>\n<blockquote>\n<h2>v13.2.1</h2>\n<h2><a href=\"https://github.com/testing-library/user-event/compare/v13.2.0...v13.2.1\">13.2.1</a> (2021-07-25)</h2>\n<h3>Bug Fixes</h3>\n<ul>\n<li><strong>keyboard:</strong> dispatch change event on blur (<a href=\"https://github-redirect.dependabot.com/testing-library/user-event/issues/703\">#703</a>) (<a href=\"https://github.com/testing-library/user-event/commit/9600abb57d28b5e356e68d858f7c8f84e17e4a54\">9600abb</a>)</li>\n</ul>\n<h2>v13.2.0</h2>\n<h1><a href=\"https://github.com/testing-library/user-event/compare/v13.1.9...v13.2.0\">13.2.0</a> (2021-07-17)</h1>\n<h3>Features</h3>\n<ul>\n<li>add keydownBehavior for <code>ArrowLeft</code> and <code>ArrowRight</code> on <code>&lt;textarea&gt;</code> (<a href=\"https://github-redirect.dependabot.com/testing-library/user-event/issues/686\">#686</a>) (<a href=\"https://github.com/testing-library/user-event/commit/f8f00d4759b52f703e8e74292169a7394363426b\">f8f00d4</a>)</li>\n</ul>\n<h2>v13.1.9</h2>\n<h2><a href=\"https://github.com/testing-library/user-event/compare/v13.1.8...v13.1.9\">13.1.9</a> (2021-05-12)</h2>\n<h3>Bug Fixes</h3>\n<ul>\n<li><strong>keyboard:</strong> do not set document selection when typing on <code>&lt;input&gt;</code> (<a href=\"https://github-redirect.dependabot.com/testing-library/user-event/issues/679\">#679</a>) (<a href=\"https://github.com/testing-library/user-event/commit/f2fec137befc7a4c4b1ce2165888f729d53eb727\">f2fec13</a>)</li>\n</ul>\n<h2>v13.1.8</h2>\n<h2><a href=\"https://github.com/testing-library/user-event/compare/v13.1.7...v13.1.8\">13.1.8</a> (2021-04-29)</h2>\n<h3>Bug Fixes</h3>\n<ul>\n<li><strong>keyboard:</strong> maintain cursor position on controlled React input (<a href=\"https://github-redirect.dependabot.com/testing-library/user-event/issues/665\">#665</a>) (<a href=\"https://github.com/testing-library/user-event/commit/03f38b9599891f9d8283b72e57904b876eae6e09\">03f38b9</a>)</li>\n</ul>\n<h2>v13.1.7</h2>\n<h2><a href=\"https://github.com/testing-library/user-event/compare/v13.1.6...v13.1.7\">13.1.7</a> (2021-04-29)</h2>\n<h3>Bug Fixes</h3>\n<ul>\n<li><strong>upload:</strong> apply changeInit correctly (<a href=\"https://github-redirect.dependabot.com/testing-library/user-event/issues/670\">#670</a>) (<a href=\"https://github.com/testing-library/user-event/commit/de09b1ba0493fda2afdb99381c6167c93e57daa4\">de09b1b</a>)</li>\n</ul>\n<h2>v13.1.6</h2>\n<h2><a href=\"https://github.com/testing-library/user-event/compare/v13.1.5...v13.1.6\">13.1.6</a> (2021-04-28)</h2>\n<h3>Bug Fixes</h3>\n<ul>\n<li><strong>keyboard:</strong> add link to README in key descriptor error (<a href=\"https://github-redirect.dependabot.com/testing-library/user-event/issues/666\">#666</a>) (<a href=\"https://github.com/testing-library/user-event/commit/ebc90d84412919e223a5ecf8620caf2394d5c737\">ebc90d8</a>)</li>\n</ul>\n</blockquote>\n</details>\n<details>\n<summary>Commits</summary>\n<ul>\n<li><a href=\"https://github.com/testing-library/user-event/commit/9600abb57d28b5e356e68d858f7c8f84e17e4a54\"><code>9600abb</code></a> fix(keyboard): dispatch change event on blur (<a href=\"https://github-redirect.dependabot.com/testing-library/user-event/issues/703\">#703</a>)</li>\n<li><a href=\"https://github.com/testing-library/user-event/commit/e5e78af412d3273c06f26df057c20ad919094189\"><code>e5e78af</code></a> docs: add tf as a contributor for bug (<a href=\"https://github-redirect.dependabot.com/testing-library/user-event/issues/707\">#707</a>)</li>\n<li><a href=\"https://github.com/testing-library/user-event/commit/17509fe9f3736f53350e507411070bace6f98e4c\"><code>17509fe</code></a> docs: fix Discord links (<a href=\"https://github-redirect.dependabot.com/testing-library/user-event/issues/705\">#705</a>)</li>\n<li><a href=\"https://github.com/testing-library/user-event/commit/1fd14e7a430840d9a535a3c62ae920f852adc79a\"><code>1fd14e7</code></a> test: fix istanbul ignore (<a href=\"https://github-redirect.dependabot.com/testing-library/user-event/issues/706\">#706</a>)</li>\n<li><a href=\"https://github.com/testing-library/user-event/commit/276d751bd09027f54c20530d3618bc0edf4aa82f\"><code>276d751</code></a> docs: move readme content to docs (<a href=\"https://github-redirect.dependabot.com/testing-library/user-event/issues/704\">#704</a>)</li>\n<li><a href=\"https://github.com/testing-library/user-event/commit/edb4d7a7c66e452ce1cfd30982cc37133fe7c671\"><code>edb4d7a</code></a> docs: update readme with changes in docs (<a href=\"https://github-redirect.dependabot.com/testing-library/user-event/issues/701\">#701</a>)</li>\n<li><a href=\"https://github.com/testing-library/user-event/commit/a31ecc90664d8ec489cea97e8e5ddb8a7ff62b83\"><code>a31ecc9</code></a> chore: rename default branch (<a href=\"https://github-redirect.dependabot.com/testing-library/user-event/issues/675\">#675</a>)</li>\n<li><a href=\"https://github.com/testing-library/user-event/commit/1bbac04a20cbfab1a8f2cdc35da69072c28043c7\"><code>1bbac04</code></a> docs: add mkurcius as a contributor for code (<a href=\"https://github-redirect.dependabot.com/testing-library/user-event/issues/700\">#700</a>)</li>\n<li><a href=\"https://github.com/testing-library/user-event/commit/f8f00d4759b52f703e8e74292169a7394363426b\"><code>f8f00d4</code></a> feat: add keydownBehavior for <code>ArrowLeft</code> and <code>ArrowRight</code> on <code>\\&lt;textarea&gt;</code> (#...</li>\n<li><a href=\"https://github.com/testing-library/user-event/commit/ffba2dff177671001440fe8f12573c5808291906\"><code>ffba2df</code></a> chore: upgrade to Jest 27 (<a href=\"https://github-redirect.dependabot.com/testing-library/user-event/issues/693\">#693</a>)</li>\n<li>Additional commits viewable in <a href=\"https://github.com/testing-library/user-event/compare/v13.1.5...v13.2.1\">compare view</a></li>\n</ul>\n</details>\n<br />\n\n\n[![Dependabot compatibility score](https://dependabot-badges.githubapp.com/badges/compatibility_score?dependency-name=@testing-library/user-event&package-manager=npm_and_yarn&previous-version=13.1.5&new-version=13.2.1)](https://docs.github.com/en/github/managing-security-vulnerabilities/about-dependabot-security-updates#about-compatibility-scores)\n\nDependabot will resolve any conflicts with this PR as long as you don't alter it yourself. You can also trigger a rebase manually by commenting `@dependabot rebase`.\n\n[//]: # (dependabot-automerge-start)\n[//]: # (dependabot-automerge-end)\n\n---\n\n<details>\n<summary>Dependabot commands and options</summary>\n<br />\n\nYou can trigger Dependabot actions by commenting on this PR:\n- `@dependabot rebase` will rebase this PR\n- `@dependabot recreate` will recreate this PR, overwriting any edits that have been made to it\n- `@dependabot merge` will merge this PR after your CI passes on it\n- `@dependabot squash and merge` will squash and merge this PR after your CI passes on it\n- `@dependabot cancel merge` will cancel a previously requested merge and block automerging\n- `@dependabot reopen` will reopen this PR if it is closed\n- `@dependabot close` will close this PR and stop Dependabot recreating it. You can achieve the same result by closing it manually\n- `@dependabot ignore this major version` will close this PR and stop Dependabot creating any more for this major version (unless you reopen the PR or upgrade to it yourself)\n- `@dependabot ignore this minor version` will close this PR and stop Dependabot creating any more for this minor version (unless you reopen the PR or upgrade to it yourself)\n- `@dependabot ignore this dependency` will close this PR and stop Dependabot creating any more for this dependency (unless you reopen the PR or upgrade to it yourself)\n\n\n</details>",
